    constructor(props) {
      super(props);
      this.state = {
        url: 'https://google.com'
      }
    }

    someEvent = (e) => {
      this.setState({ url: 'https://facebook.com' });
    }

    render(){
      const { url } = this.state;
      return(
        <React.Fragment>
          <WebView source={{uri: url}} />
          <Button title='button' onClick={this.someEvent} />
